import React, { useState } from 'react';
import MovieList from './comp/MovieList';
import Filter from './comp/Filter';
import './App.css';

const App = () => {
  const [movies, setMovies] = useState([
    {
      title: 'BIRD BOX',
      description: 'Description du Film 1',
      posterURL: 'data:image/jpeg;base64,',
      rating: 4,
    },
    {
      title: 'GHOSTED',
      description: 'description de film',
      posterURL: 'data:image/jpeg;base64,',
      rating: 3,
    },
    // ... Ajoutez d'autres films ici ...
    {
      title: 'THE INVISIABLE GUEST',
      description: 'Description du Film 1',
      posterURL: 'data:image/jpeg;base64,',
      rating: 7,
    },
    {
      title: 'GLASS ONION',
      description: 'Description du Film 1',
      posterURL: 'data:image/jpeg;base64,',
      rating: 4,
    },
  ]);

  const [filteredTitle, setFilteredTitle] = useState('');
  const [filteredRating, setFilteredRating] = useState('');

  const handleFilterTitle = (title) => {
    setFilteredTitle(title);
  };

  const handleFilterRating = (rating) => {
    setFilteredRating(rating);
  };

  const filteredMovies = movies.filter(
    (movie) =>
      movie.title.toLowerCase().includes(filteredTitle.toLowerCase()) &&
      (!filteredRating || movie.rating >= parseInt(filteredRating, 10))
  );

  return (
    <div className="app">
      <Filter
        handleFilterTitle={handleFilterTitle}
        handleFilterRating={handleFilterRating}
      />
      <MovieList movies={filteredMovies} />
    </div>
  );
};

export default App;